        GetAllWord().then(value => {
            result = value
        });
        console.log(result);
        return result;
    }

    return (
        <div className = 'body'>
            <button onClick={addThemeHandler}>cheate new them</button>
            <ModalWindow words = {addThemeHandler()}/>
